import ListItem from "./ListItem/ListItem";
import Card from "../Card/Card";
import './List.css'

function List(props){

    const saveClickTrue = (checkboxData) => {
        const checkData = {
          ...checkboxData,
          id:Math.random().toString()
        };
        props.onCheckTrue(checkData);
      }
    return(
    <Card className="expenses">
        <ListItem raraty={props.array[0].raraty} hex={props.array[0].hex} onCheckTrue={saveClickTrue}/>
        <ListItem raraty={props.array[1].raraty} hex={props.array[1].hex} onCheckTrue={saveClickTrue}/>
        <ListItem raraty={props.array[2].raraty} hex={props.array[2].hex} onCheckTrue={saveClickTrue}/>
    </Card>
    );
}

export default List;
